	        var count = 0;
	        var index = 0;

	        for (var y = ellipse.top; y < ellipse.top + ellipse.height; y++) {
	            for (var x = ellipse.left; x < ellipse.left + ellipse.width; x++) {
	                sum += sp[index];
	                sumSquared += sp[index] * sp[index];
	                count++;
	                index++;
	            }
	        }

	        if (count === 0) {
	            return {
	                count: count,
	                mean: 0.0,
	                variance: 0.0,
	                stdDev: 0.0
	            };
	        }

	        var mean = sum / count;
	        var variance = sumSquared / count - mean * mean;

